import "./second.css"
import Card from './Card'
function Second() {
  return (
    <div className='secondContainer'>
      <Card icon={<i className="fa-regular fa-lightbulb"></i>}></Card>
      <Card></Card>
      <Card></Card>

    </div>
  )
}

export default Second
